import React, { useEffect, useState } from 'react';
import productService from './productService'; // Adjust the import based on your file structure
import './ProductManagement.css';

const ProductManagement = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const [newProduct, setNewProduct] = useState({
    name: '',
    description: '',
    price: '',
    stock: '',
    imageUrl: ''
  });

  useEffect(() => {
    async function fetchProducts() {
      try {
        const data = await productService.getAllProducts();
        setProducts(Array.isArray(data) ? data : data.products || []);
      } catch (err) {
        console.error("Error fetching products:", err);
        setError(err.message || "Failed to fetch products.");
      } finally {
        setLoading(false);
      }
    }
    fetchProducts();
  }, []);

  const handleDelete = async (productId) => {
    try {
      await productService.deleteProduct(productId); // Implement this in your productService
      setProducts(products.filter(product => product.id !== productId)); // Remove deleted product from state
    } catch (err) {
      console.error("Error deleting product:", err);
      setError(err.message || "Failed to delete product.");
    }
  };

  const handleAddProduct = async (e) => {
    e.preventDefault();
    try {
      const createdProduct = await productService.addProduct(newProduct); // Implement this in your productService
      setProducts([...products, createdProduct]); // Add new product to state
      setNewProduct({ name: '', description: '', price: '', stock: '', imageUrl: '' }); // Reset form
    } catch (err) {
      console.error("Error adding product:", err);
      setError(err.message || "Failed to add product.");
    }
  };

  if (loading) return <div>Loading...</div>;
  if (error) return <div className="error-message">{error}</div>;

  return (
    <div className="product-management-container">
      <h1>Product Management</h1>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Description</th>
            <th>Price</th>
            <th>Stock</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {products.map(product => (
            <tr key={product.id}>
              <td>{product.name}</td>
              <td>{product.description}</td>
              <td>{product.price}</td>
              <td>{product.stock}</td>
              <td>
                <button onClick={() => handleDelete(product.id)}>Delete</button>
                {/* You can add an update button here if needed */}
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <div className="update-form">
        <h2>Add New Product</h2>
        <form onSubmit={handleAddProduct}>
          <label>Name:</label>
          <input
            type="text"
            value={newProduct.name}
            onChange={(e) => setNewProduct({ ...newProduct, name: e.target.value })}
            required
          />

          <label>Description:</label>
          <input
            type="text"
            value={newProduct.description}
            onChange={(e) => setNewProduct({ ...newProduct, description: e.target.value })}
            required
          />

          <label>Price:</label>
          <input
            type="number"
            value={newProduct.price}
            onChange={(e) => setNewProduct({ ...newProduct, price: e.target.value })}
            required
          />

          <label>Stock:</label>
          <input
            type="number"
            value={newProduct.stock}
            onChange={(e) => setNewProduct({ ...newProduct, stock: e.target.value })}
            required
          />

          <label>Image URL:</label>
          <input
            type="text"
            value={newProduct.imageUrl}
            onChange={(e) => setNewProduct({ ...newProduct, imageUrl: e.target.value })}
          />

          <button type="submit">Add Product</button>
        </form>
      </div>
    </div>
  );
};

export default ProductManagement;
